const React = require("react")

const Sweet = (props) => {
    return (<> 
         <h1>Sweet Page</h1>
         <div>
             {props.data.map((value) =>(
                <img src = {value}></img>
             ))}
         </div>
    </>)  
}

module.exports = Sweet
